import React from 'react';
import { Card, Alert } from 'react-bootstrap';

const MovementForm = () => {
  return (
    <Card>
      <Card.Header>Register Movement</Card.Header>
      <Card.Body>
        <Alert variant="info">
          Esta funcionalidad está en desarrollo. Estará disponible próximamente.
        </Alert>
      </Card.Body>
    </Card>
  );
};

export default MovementForm;
